const swiper=new Swiper(".swiper-container",{spaceBetween:30,loop:!0,pagination:{el:".swiper-pagination",clickable:!0}});$(".counter").each((function(){let t=$(this),e=t.attr("data-count");$({countNum:t.text()}).animate({countNum:e},{duration:6e3,easing:"linear",step:function(){t.text(Math.floor(this.countNum))},complete:function(){t.text(this.countNum)}})}));